import React from 'react';
import {Link} from 'react-router-dom';
import logo from "../images/CTVLogoCleanCopy.png";
import about_us from './AboutUs';

const Navbar = () => {
    return (
    <header id="header">
        <div className="inner">
            <Link to="/" className="logo">
            <img src={logo} style={{width: 'auto', height: 50, display: 'block', marginLeft: 'auto', marginRight: 'auto'}} alt="Home" />
            </Link>
            <nav id="nav">
            <Link to="/">Home</Link>
            <Link to="/faq">FAQ</Link>
            <Link to={{ pathname: "https://example.zendesk.com/hc/en-us/articles/123456789-Privacy-Policies" }} target="_blank" >RE</Link>
            <Link to="/about_us" component={about_us}>About Us</Link>
            <Link to="/login">Log In/Register</Link>
            </nav>
            <Link to="#navPanel" className="navPanelToggle"><span className="fa fa-bars" /></Link>
        </div>
    </header>
      
    );
};

export default Navbar;
